// ==UserScript==
// @icon         data:image/x-icon;base64,
// @name         好友和最近游戏中显示VAC状态
// @namespace    SteamVAC
// @author       By:Svlik
// @description  可以检查好友列表和游戏列表中好友的VAC状态。QQ:122474363 Blog：https://www.svlik.com/ & https://steamcommunity.com/id/Svlik/
// @version      1.5
// @include      http*://steamcommunity.com/*/friends*
// @grant        GM_addStyle
// @grant        GM_xmlhttpRequest
// ==/UserScript==

javascript: (
    (function () {
        'use strict';

        var friends = document.querySelectorAll(".friend_block_v2"),
            progress = document.createElement("div"),
            xmlHttp, queue = [],
            isProcessing = false,
            id, processed = 0,
            banned = 0,
            time = 500, //自动检测的间隔，默认500毫秒，1秒=1000毫秒，可手工设置。
            key = "Q0VEOEIzNTZCNzJDRkFFREVBNTcxMDQ2Qzg3NTQyNjc=",
            finished = false;
        if (XMLHttpRequest) {
            xmlHttp = new XMLHttpRequest()
        } else {
            xmlHttp = new ActiveXObject("Microsoft.XMLHTTP")
        }
        document.querySelector(".profile_friends.title").innerHTML += "<span id='banned_status'>没有人被封禁</span>";
        var bS = document.querySelector("#banned_status");
        progress.style.cssText = "position:fixed;width:0;height:5px;top:0;left:0;z-index:99999999;box-shadow:0 0 5px #66CCFF;background-color:#66CCFF;transition:width .3s ease-out,top .1s linear;border-top-right-radius:2.5px;border-bottom-right-radius:2.5px;";
        progress = document.body.appendChild(progress);
        xmlHttp.onreadystatechange = onRespd;
        for (var friend of friends) {
            queue.push(friend.dataset.steamid)
        }
        /*
        function b64Encode(str) {
            return btoa(encodeURIComponent(str));
            }
        */
        function b64Decode(str) {
            return decodeURIComponent(atob(str));
            }

        function setStatus(a, b) {
            if (b.error) {
                console.log("%c发生了错误：" + b.status);
                updateProgress();
                if (finished) {
                    updateProgress()
                }
                isProcessing = false;
                return
            }
            for (var c of friends) {
                if (c.dataset.steamid == a) {
                    if (b.players[0].VACBanned) {
                        banned++
                    }
                    c.getElementsByClassName("friend_block_content")[0].innerHTML = "<span style='color:" + (b.players[0].VACBanned ? "red" : "green") + ";'>[" + (b.players[0].VACBanned ? b.players[0].DaysSinceLastBan + "天前被封禁一次]" : "无封禁记录]") + "</span>" + c.getElementsByClassName("friend_block_content")[0].innerHTML
                }
            }
            updateProgress();
            if (finished) {
                updateProgress()
            }
            isProcessing = false
        }

        function updateProgress() {
            var a = parseInt(progress.style.width.replace(/[^\d.]/g, ""));
            progress.style.width = (a + document.body.clientWidth / friends.length) + "px";
            processed++
        }

        function onRespd() {
            if (xmlHttp.readyState == 4) {
                if (xmlHttp.status == 200) {
                    var a = JSON.parse(xmlHttp.responseText);
                    setStatus(a.players[0].SteamId, a)
                } else {
                    var b = [error = true, status = xmlHttp.status];
                    setStatus(null, b)
                }
            }
        }
        id = setInterval(function () {
            bS.innerHTML = ((banned === 0) ? "没有人被封禁" : "有<strong>" + banned + "</strong>人被封禁");
            if (isProcessing) {
                return
            }
            xmlHttp.open("GET", "https://api.steampowered.com/ISteamUser/GetPlayerBans/v1/?key=" + b64Decode(key) + "&steamids=" + queue[0], true);
            xmlHttp.send(null);
            queue.shift();
            if (queue.length === 0) {
                clearInterval(id);
                finished = true;
                setTimeout(function () {
                    progress.style.top = "-5px";
                    setTimeout(function () {
                        document.body.removeChild(progress)
                    }, 100)
                }, 2000)
            }
            isProcessing = true
        }, time);
        window.onresize = function () {
            progress.style.width = (processed * (document.body.clientWidth / friends.length)) + "px"
        }
    }))();